#region ButtonFunctions
function run-RemoteCCMActions { 
    ###This function runs all CCM actions found in the control panel###
    param (
        $session
    )
    try{
    Invoke-Command -Session $session -ScriptBlock {
        #The cmd commands for some reason need a variable otherwise they will not run. notneededvar = definitely needed var.
        $notneededvar = cmd.exe /c "WMIC /namespace:\\root\ccm path sms_client CALL TriggerSchedule '{00000000-0000-0000-0000-000000000121}' /NOINTERACTIVE" 2>&1# App deployment evaluation cycle
        $notneededvar = cmd.exe /c "WMIC /namespace:\\root\ccm path sms_client CALL TriggerSchedule '{00000000-0000-0000-0000-000000000003}' /NOINTERACTIVE" 2>&1# discovery data collection cycle
        $notneededvar = cmd.exe /c "WMIC /namespace:\\root\ccm path sms_client CALL TriggerSchedule '{00000000-0000-0000-0000-000000000001}' /NOINTERACTIVE" 2>&1# hardware inventory cycle
        $notneededvar = cmd.exe /c "WMIC /namespace:\\root\ccm path sms_client CALL TriggerSchedule '{00000000-0000-0000-0000-000000000021}' /NOINTERACTIVE" 2>&1# Machine Policy Retrieval cycle
        $notneededvar = cmd.exe /c "WMIC /namespace:\\root\ccm path sms_client CALL TriggerSchedule '{00000000-0000-0000-0000-000000000022}' /NOINTERACTIVE" 2>&1# Machine policy evaluation Cycle
        $notneededvar = cmd.exe /c "WMIC /namespace:\\root\ccm path sms_client CALL TriggerSchedule '{00000000-0000-0000-0000-000000000031}' /NOINTERACTIVE" 2>&1# Software Metering Usage Report Cycle
        $notneededvar = cmd.exe /c "WMIC /namespace:\\root\ccm path sms_client CALL TriggerSchedule '{00000000-0000-0000-0000-000000000108}' /NOINTERACTIVE" 2>&1# Software updates Deployment Evaluation Cycle
        $notneededvar = cmd.exe /c "WMIC /namespace:\\root\ccm path sms_client CALL TriggerSchedule '{00000000-0000-0000-0000-000000000113}' /NOINTERACTIVE" 2>&1# Software Update Scan Cycle
        $notneededvar = cmd.exe /c "WMIC /namespace:\\root\ccm path sms_client CALL TriggerSchedule '{00000000-0000-0000-0000-000000000026}' /NOINTERACTIVE" 2>&1# User Policy Retrieval Cycle
        $notneededvar = cmd.exe /c "WMIC /namespace:\\root\ccm path sms_client CALL TriggerSchedule '{00000000-0000-0000-0000-000000000027}' /NOINTERACTIVE" 2>&1# User Policy Evaluation Cycle
        $notneededvar = cmd.exe /c "WMIC /namespace:\\root\ccm path sms_client CALL TriggerSchedule '{00000000-0000-0000-0000-000000000032}' /NOINTERACTIVE" 2>&1 # Windows Installers Source List Update Cycle
    }
    }catch { return "Error running actions" }
    return "CCM Actions Ran on $session"
}

function reset-remotePOLFile {
    ###This function resets the registry.pol file located in C:\windows\System32\GroupPolicy\machine\registry.pol###
    param (
        $session
    )
    try{
        Invoke-Command -Session $session -ScriptBlock {
        $filepath = "C:\windows\System32\GroupPolicy\machine\registry.pol"
        $fileinfo = Get-ChildItem $filepath
        $basename = $fileinfo.BaseName
        $NewExtension = "bak"
        if ( Test-Path "C:\windows\System32\GroupPolicy\machine\registry.bak" ) { Remove-Item -Path "C:\windows\System32\GroupPolicy\machine\registry.bak" }
        rename-item $filepath ($basename+".$newExtension")}
    }catch{ return Write-Host -ForegroundColor Red "Could not reset registry.pol on $session" }
        return "registry.pol reset on $session"
}

function verify-remoteWMI {
    ###verifies and repairs WMI on remote machine###
    param(
        $session
    )
    $compName = $session.computername
    
    try{
    $winstatus = Invoke-Command -Session $session -ScriptBlock { winmgmt /verifyrepository }
    }catch{ return "Error verifying remote WMI"}
        if ($winstatus -contains "inconsistent"){
            try{
                Invoke-Command -Session $session -ScriptBlock { winmgmt /salvagerepository }
            }catch{ return "Unable to salvage remote repository"}
            return "WMI successfully repaired on $compName"
        }else{
            return "WMI is healthy on $compName"
        }
    }

function est-remoteSession {
###Establishes remote PSSession on port 8081###
    param ( $computerName )
    if ($software -eq "Enter Computer name here") {Return "Enter Hostname!"}
    try{
        $session = New-PSSession -ComputerName $computerName -Name $computerName
        }catch{ return "Could not establish remote session" }
        return "Live session established with $computerName"
}

function run-GPUpdate {
###if you really dont know what this part does, i pray for you.###
    param ($session)
    
    $GPOutput = Invoke-Command -Session $session -ScriptBlock { gpupdate /force }
    if ($GPOutput -match "has completed successfully"){ return "GPUpdate has completed successfully" }
    else{ return "GPUpdate has failed on $session" }
}

function repair-CCMClient {
###Repairs ccm and verifies it works###
    param ($session)

    $compName = $session.ComputerName
    $logFile = "\\$compName\c$\Windows\ccmsetup\Logs\ccmsetup.log"

    try { 
    Invoke-Command -Session $session -ScriptBlock { Set-Content -Path $Using:logFile -Value "" -Force } ##Makes a fresh log file by clearing the old one
    $output = Invoke-Command -Session $session -ScriptBlock { & "C:\Windows\CCM\ccmrepair.exe" } -ErrorAction Stop
    }catch{ return "Error repairing CCM Client on $session" }
            if (Test-Path $logFile) {
                $logContent = Get-Content $logFile -Raw
            }else{
                     return "Cannot verify repair status on $session"
            }
            if ($logContent -like "*Installation completed successfully*" -or $logContent -like "*client.msi installation succeeded*") {
                        return "Successfully repaired CCM Client on $session"
                }else{ return "Failed to repair CCM Client on $session" }
}

function get-softwareVersion {
###Gets specified software version###
    param (
        $session,
        [String]$software
    )
    if ($software -eq "Enter Simple Software Name") {Return "Enter Software!!!"}
    try{

    $version = Invoke-Command -Session $session -ScriptBlock { Get-WmiObject -Class win32_product | where Name -match $using:software | select -ExpandProperty Version }
    $name = Invoke-Command -Session $session -ScriptBlock { Get-WmiObject -Class win32_product | where Name -match $using:software | select -ExpandProperty Name }

    if ($name -eq $null -and $version -eq $null) { return "Could not locate $software on $session. Try a different software name" }
    else { return "$name : $version" }

    }catch{ return "Could not locate $software on $session" }

}

function get-sysInfoBrief {
###To get brief info###
    param ( $session )
    try{
        $data = @()
        $IP = [System.net.dns]::GetHostAddresses($session.ComputerName) | Select-Object IPAddressToString -ExpandProperty IPAddressToString
        $MAC = "MAC: " + (Get-WmiObject -Class win32_networkadapterconfiguration -Filter "IPEnabled='True'" -ComputerName $session.ComputerName).MACAddress
        $user = Invoke-Command -Session $session -scriptblock { (Get-ItemProperty -Path HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Authentication\LogonUI).lastloggedonuser }

        $data += "IP:" + $IP
        $data += $MAC
        $data += "Logged on User: " + $user

    }catch{
        return "Could not retrieve data"
    }
    return $data
}

function get-sysInfoMore {
###to get more info###
    param ( $session )
    try{
        $data = @()
        $user = Invoke-Command -Session $session -scriptblock { (Get-ItemProperty -Path HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Authentication\LogonUI).lastloggedonuser }
        $hotFix = "Last Hotfix: " + (Get-HotFix -ComputerName $session.ComputerName | Sort-Object InstalledOn -Descending | Select-Object -First 1).InstalledOn
        
        $driveSpace = Invoke-Command -Session $session -ScriptBlock { 
            $temp =  (Get-Volume | Where-Object { $_.DriveLetter -eq 'C' }).SizeRemaining
            $temp = [math]::Round( $temp / 1GB, 2 )
            $temp
            }
        $driveSpace = "Remaining Disk Space: " + $driveSpace + "GB"

        $meta = Invoke-Command -Session $session -ScriptBlock { Get-WmiObject Win32_ComputerSystem }

        $Domain = "Domain:" + $meta.Domain
        $model = "Model" + $meta.Manufacturer + " " + $meta.Model
        
        $meta = Invoke-Command -Session $session -ScriptBlock { Get-WmiObject Win32_OperatingSystem }
        
        $OSVersion = "OS: " + $meta.Caption + " : " + $meta.Version
        $OSBuildNo = "OS Build No.: " + $meta.BuildNumber
        
        
        $meta = Invoke-Command -Session $session -ScriptBlock { Get-WmiObject win32_networkAdapterconfiguration -Filter "IPEnabled='True'" }
        
        $IP = "IP: " + $meta.IPAddress
        $MAC = "MAC: " + $meta.MACAddress
        $GateWay = "Gateway: " + $meta.DefaultIPGateway
        
        $meta = Invoke-Command -Session $session -ScriptBlock { Get-WmiObject win32_Bios }
        
        $SNo = "Serial: " + $meta.SerialNumber
        $biosVersion = "Bios Version: " + $meta.SMBIOSBIOSVersion

        $data += $domain
        $data += $OSVersion
        $data += $OSBuildNo
        $data += $IP
        $data += $MAC
        $data += $GateWay
        $data += "Logged on User: " + $user
        $data += $SNo
        $data += $Model
        $data += $biosVersion
        $data += $hotFix
        $data += $driveSpace

    }catch{
        return "Could not retrieve data"
    }
    return $data
}


function check-availSoftware {
###Checks software center for available software###
    param ($session)
    try{
    $ccmSoftware = @()
        $availSoftware = (Get-CimInstance -ComputerName $session.ComputerName -Namespace root/ccm/ClientSDK -ClassName CCM_SoftwareBase | where EvaluationState -EQ 3).FullName
        $taskSequences = (Get-WmiObject -ComputerName $session.ComputerName -Namespace root/ccm/policy/machine/requestedconfig -Class ccm_tasksequence).PKG_Name
        ##$taskSeqComment = (Get-WmiObject -ComputerName $session.ComputerName -Namespace root/ccm/policy/machine/requestedconfig -Class ccm_tasksequence).PRG_Comment
        $noncomSoftware = (Get-CimInstance -ComputerName $session.ComputerName -ClassName CCM_SoftwareUpdate -Namespace "root\ccm\clientSDK" -Filter "ComplianceState = 0").FullName
        foreach ($item in $availSoftware) {
         $ccmSoftware += $item } 
        $noncomSoftware | ForEach-Object { $ccmSoftware += $_ }
        $taskSequences | ForEach-Object { $ccmSoftware += $_ }
        if($ccmSoftware -eq $null) { Return "No updates found" }
    }catch{ return "Could not retrieve CCM data" }
    return $ccmSoftware
}

function get-users {
###Gets all currently logged on users###
    param ( $session )
    
    try{
        Invoke-Command -Session $session -ScriptBlock {
            $quserResult = quser 2>&1
            $quserRegex = $quserResult | ForEach-Object -Process { $_ -replace '\s{2,}', ',' }
            $quserObject = $quserRegex | ConvertFrom-Csv
            
            if ($quserObject -eq $null){ return "Could not find any users" }
            else{
                return $quserObject
            }
        }
    }catch{ return "Could not find any users" }

}

function hog-offUsers {
###Logs off users###
    param ( $session )
        Invoke-CimMethod -ClassName Win32_Operatingsystem -ComputerName $session.ComputerName -MethodName Win32Shutdown -Arguments @{ Flags = 4 }
}

function Write-Log {
###For writing logs to console###
    param (
    [string]$message
    )
    $logbox.AppendText("$message `r`n")
}

function clear-CCMCache {
###Clears CCM Cache###
    param ( $session )
    $compName = $session.ComputerName
    try{
        Invoke-Command -Session $session -ScriptBlock { Remove-Item -Path C:\Windows\ccmcache\* -Force -Recurse }
        $stuff = ls "\\$compName\c$\Windows\ccmcache\"
        if ($stuff -eq $null){ return "CCM Cache has successfully cleared" }
        else{ return "Failed to clear CCM Cache on $compName" }
    }catch{
        return "Could not clear CCM Cache on $compName"
    }

}

function restart-SpecifiedService {
###Restarts the specified service###
    param (
    $session, [String]$service
    )

    if (($service -like "Enter simple service name") -or ($service -eq "" )){
        return "Enter a service name!"
    }

    [String]$serviceName = '*' + $service + '*'

    try{
        $selectedService = Invoke-Command -Session $session -ScriptBlock { Get-Service $Using:serviceName } -ErrorAction Stop
    }catch{ return "Could not find $service" }

        $ServiceName = $selectedService.Name
        if ($selectedService.Status -eq "Running"){
                Invoke-Command -Session $session -ScriptBlock { 
                    Restart-Service $Using:selectedService
                    $check1 = Get-Service $serviceName
                    if ($check1.Status -eq "Running"){
                    return "$Using:serviceName has been restarted"
                }else{
                    return  "Failed to restart $serviceName" 
                }
            }
        }else{
            return "Error: Service $service not running"
        }
}

function open-CDrive {
###Opens the C Drive###
    param ($session)

    $comp = $session.ComputerName
    $OpenFileDialog = New-Object System.Windows.Forms.OpenFileDialog
	$OpenFileDialog.initialDirectory = "\\$comp\c$"
	$OpenFileDialog.filter = "All files (*.*)| *.*"
	$OpenFileDialog.ShowDialog() | Out-Null
    return
}

